import styled from 'styled-components';
export const HomeWrapper = styled.div`
  overflow:hidden;
  width:960px;
  margin:0 auto;
  border-bottom:1px solid #dcdcdc;
`;
export  const HomeLeft = styled.div`
  width:625px;
  margin-left:15px;
  padding-top:30px;
  float:left;
  .banner-img{
      width:625px;
      height:270px;
  }
`;
export  const Homeright = styled.div`
  width:240px;
  float:right;
`;
export const ListItem = styled.div`
overflow:hidden;
  padding:20px 0;
  border-bottom:1px solid #dcdcdc;
  .List-pic{
    display:block;
    width:125px;
    height:100px;
    float:right;
    border-radius:10px;
  }
`;
export const ListInfo = styled.div`
  width:500px;
  float:right;
  .title{
    line-height:27px;
    font-size:18px;
    font-weight:bold;
    color:#333;

  }
  .desc{
    line-height:18px;
    font-size:13px;
    color:#999;

  }
`
